column8:
世界的な超有名DECKブランドと同じ工場で作られる "ハイクオリティ" なR2 WOOD DECKは、軽くて丈夫で耐久性もバツグン！ <br>
<br>
R2 WOODのブランクデッキは有名ブランドのプロモデルと同様の非常に高品質なDECKを使用しています。ただ、プリントが有るか無いかの違いです。<br>
<br> 
最高品質のCANADIAN HARDROCK MAPLEを７枚全てのPLYに100%使用し、圧着には航空機等の超ハイテク製品に使用されるRESIGN EPOXY GLUEを用いたDECK!! <br>
<br>
永年にわたり多くのアメリカのトップブランドとの直接取引き＆交流を活かし、多くの有名ブランドに高品質なDECKを供給する工場に直接発注し直接販売する事で、余計な運送費や中間マージンを一切取り除く事が可能となり、この非常に高品質なDECKの驚きの低価格が実現しました。<br><style type="text/css">
